Step-by-step reasoning:

1. Key psychological mechanisms:  
 • Responders care about the absolute amount they receive (split_self) but also evaluate offers relative to a fairness benchmark determined by their token contribution relative to the total tokens (token_self and token_opp) and the available combined money (combined_earning).  
 • Diminishing sensitivity: The utility from money increases nonlinearly (often with diminishing returns).  
 • Fairness or inequity aversion: Offers below the fairness benchmark are penalized.  

2. Interaction of these mechanisms:  
 • First, compute a fairness reference point (r) as the share of money that corresponds to the participant’s token contribution.  
 • Then, if the offer (split_self) falls beneath that benchmark, a penalty applies.  
 • This penalty and the sensitivity to monetary gains are both captured by power transformations to allow for nonlinearity (diminishing sensitivity) that applies to both the monetary amount and the fairness gap.  

3. Mathematical formulation:  
 • Let r = combined_earning × (token_self / (token_self + token_opp)) be the fairness benchmark generated by the relative token contributions.  
 • Define the fairness gap as gap = max(r − split_self, 0).  
 • The utility for a responder accepting an offer is then:  
  U = (split_self)^(alpha) − lambda × (gap)^(alpha)  
 Here, alpha (> 0) controls the curvature (diminishing sensitivity) and lambda (≥ 0) scales the penalty for offers that fall short of the fairness benchmark.  

4. Learnable parameters and mapping to observable behavior:  
 • The model uses two learnable parameters: alpha and lambda.  
 • Alpha modulates the (nonlinear) reward from the money received as well as how the fairness gap is processed.  
 • Lambda adjusts the strength of the penalty when the offer is below what is “fair” given token contributions.  
 • Observed variables (split_self, token_self, token_opp, and combined_earning) are used to calculate both the reward and the fairness benchmark, linking the model to the dataset.  

Below is the formal model specification and the variable description.

